import React from "react";

import logo from "../../../public/assets/images/logo/logo-220x63.svg";

class LogoSVG extends React.Component {
  render() {
    return <img src={logo} alt="Logo SOCIAL MEDIA" />;
  }
}

export default LogoSVG;
